      this.state = {

      }
   }

   render() {
      return (
         <div className="App" id="homePage">
            <div>
               <div className="image-blurred-edge"></div>
            </div>

            <div>
               <div id="homeName">Michael Muzzy</div>
               <div id='homePageQuote'>
                  Web Developer
                  <br/>
                  Business Operations
                  <br/>
                  RC Airplane Pilot
            </div>
            </div>

         </div>

      )
   }
}

export default Home
